import 'dart:convert';
import 'dart:ui';

import 'package:flutter/material.dart';

import 'package:ln_core/ln_core.dart';

class GlassCardTheme extends ThemeExtension<GlassCardTheme> {
  const GlassCardTheme({
    this.gradient = false,
    this.depth = 3,
    this.color,
    this.borderRadius = const BorderRadius.all(Radius.circular(12)),
    this.borderSide,
    this.noiseEffect = 0,
  }) : assert(noiseEffect >= 0 && noiseEffect <= 1.0);

  final bool gradient;
  final Color? color;
  final double depth;
  final double noiseEffect;
  final BorderSide? borderSide;
  final BorderRadiusGeometry borderRadius;

  static const _defaultLightColor = Color(0xFF616161);
  static const _defaultDarkColor = Color(0xFFE0E0E0);

  static const _defaultLight = GlassCardTheme(color: _defaultLightColor);
  static const _defaultDark = GlassCardTheme(color: _defaultDarkColor);

  static GlassCardTheme defaultsOf(Brightness brightness) =>
      switch (brightness) {
        Brightness.light => _defaultLight,
        Brightness.dark => _defaultDark,
      };

  static Color defaultColorOf(Brightness brightness) => switch (brightness) {
        Brightness.light => _defaultLightColor,
        Brightness.dark => _defaultDarkColor,
      };

  @override
  GlassCardTheme copyWith({
    Color? color,
    double? depth,
    double? noiseEffect,
    BorderRadiusGeometry? borderRadius,
    BorderSide? borderSide,
  }) {
    return GlassCardTheme(
      color: color ?? this.color,
      depth: depth ?? this.depth,
      noiseEffect: noiseEffect ?? this.noiseEffect,
      borderRadius: borderRadius ?? this.borderRadius,
      borderSide: borderSide ?? this.borderSide,
    );
  }

  @override
  ThemeExtension<GlassCardTheme> lerp(
      covariant GlassCardTheme? other, double t) {
    return other == null
        ? this
        : GlassCardTheme(
            depth: lerpDouble(depth, other.depth, t)!,
            color: Color.lerp(color, other.color, t)!,
            borderRadius:
                BorderRadiusGeometry.lerp(borderRadius, other.borderRadius, t)!,
            borderSide: switch ((borderSide, other.borderSide)) {
              (null, null) => null,
              (_, null) => t < .5 ? borderSide : null,
              (null, _) => t >= .5 ? other.borderSide! : null,
              (_, _) => BorderSide.lerp(borderSide!, other.borderSide!, t)
            },
            noiseEffect: lerpDouble(noiseEffect, other.noiseEffect, t)!,
          );
  }
}

extension GlassCardThemeExtension on ThemeData {
  GlassCardTheme get glassCardTheme =>
      extension<GlassCardTheme>() ?? GlassCardTheme.defaultsOf(brightness);
}

class GlassCard extends StatelessWidget {
  const GlassCard({
    super.key,
    this.color,
    this.gradient,
    this.depth,
    this.noiseEffect,
    this.borderRadius,
    this.borderSide,
    this.child,
  }) : assert(noiseEffect == null || (noiseEffect >= 0 && noiseEffect <= 1.0));

  final bool? gradient;
  final Color? color;
  final double? depth;
  final double? noiseEffect;
  final BorderRadiusGeometry? borderRadius;
  final BorderSide? borderSide;

  final Widget? child;

  @override
  Widget build(BuildContext context) {
    final theme = Theme.of(context);
    final glassTheme = theme.glassCardTheme;
    final depth = this.depth ?? glassTheme.depth;
    final color = this.color ??
        glassTheme.color ??
        GlassCardTheme.defaultColorOf(theme.brightness);
    final gradient = this.gradient ?? glassTheme.gradient;
    final noiseEffect = this.noiseEffect ?? glassTheme.noiseEffect;
    final borderRadius = this.borderRadius ?? glassTheme.borderRadius;
    final borderSide =
        this.borderSide ?? glassTheme.borderSide ?? BorderSide(color: color);

    final decoration = BoxDecoration(
      color: color,
      image: DecorationImage(
        image: televisionNoiseImage,
        fit: BoxFit.none,
        repeat: ImageRepeat.repeat,
        scale: 5,
        opacity: noiseEffect / 10,
        colorFilter: ColorFilter.mode(color, BlendMode.color),
        isAntiAlias: true,
      ),
      gradient: gradient
          ? LinearGradient(
              begin: Alignment.bottomLeft,
              end: Alignment.topRight,
              colors: [
                color.withOpacityFactor(1.33),
                color,
              ],
            )
          : null,
    );

    return ClipRRect(
      borderRadius: borderRadius,
      child: BackdropFilter(
        filter: ImageFilter.blur(sigmaX: depth * 2, sigmaY: depth * 2),
        child: Material(
          type: MaterialType.transparency,
          shape: RoundedRectangleBorder(
            borderRadius: borderRadius,
            side: borderSide,
          ),
          child: DecoratedBox(
            decoration: decoration,
            child: child,
          ),
        ),
      ),
    );
  }
}

const b64televisionNoise =
    "";
const decoder = Base64Decoder();
final televisionNoiseImage = MemoryImage(decoder.convert(b64televisionNoise));
